<script setup lang="ts">
import { ref } from "vue";

import * as pdfMake from "pdfmake/build/pdfmake";
import * as pdfFonts from "pdfmake/build/vfs_fonts";

(<any>pdfMake).vfs = pdfFonts.pdfMake.vfs;

defineProps<{ msg: string }>();

const count = ref(0);

const tryPdfOut = () => {
  console.log("start tryPdf out ...");
  const docDefinition = {
    header: getFooterContent(),
    footer: getFooterContent(),
    pageMargins: [60, 150, 60, 150],
    pageSize: "A4",
    pageOrientation: "landscape",
    content: [getBodyContent()],
  };
  pdfMake.createPdf(docDefinition).open();
};

const getBodyContent = () => {
  return {
    image: getSampleB64Image(),
    fit: [800, 300], // [横幅、高さ]
    //A4 595 x 841 およそ
    alignment: "center",
  };
};
const getFooterContent = (currentPage, pageCount, pageSize) => {
  return {
    layout: "lightHorizontalLines", // optional
    table: {
      // headers are automatically repeated if the table spans over multiple pages
      // you can declare how many rows should be treated as headers
      headerRows: 1,
      widths: ["*", "auto", 100, "*"],

      body: [
        ["First", "Second", "Third", "The last one"],
        ["Value 1", "Value 2", "Value 3", "Value 4"],
        [{ text: "Bold value", bold: true }, "Val 2", "Val 3", "Val 4"],
        ["First", "Second", "Third", "The last one"],
        ["Value 1", "Value 2", "Value 3", "Value 4"],
        [{ text: "Bold value", bold: true }, "Val 2", "Val 3", "Val 4"],
      ],
    },
  };
};

const getSampleB64Image = () => {
  return "data:image/jpeg;base64,";
};
</script>

<template>
  <h1>{{ msg }}</h1>
  <button @click="tryPdfOut()">try pdf out</button>
</template>

